import classes from "./LoginBackground.module.css";
import LoginMainFrame from "./LoginMainFrame";

function Test() {
    return (
        <div className={classes.container}>
            <div className={classes.outerWrap}>
                <div className={classes.title}>登入</div>
                <LoginMainFrame />
                <div>註冊</div>
            </div>
        </div>
    );
}

export default Test;
